   "source": [
    "# what's below works but in kaggle notebooks the initial loading in of the esri2sf package is horrendously slow...\n",
    "# wgtn_cctv_url <- \"https://services1.arcgis.com/CPYspmTk3abe6d7i/arcgis/rest/services/CCTV_Viewsheds_(View_layer)/FeatureServer/0\"\n",
    "# wgtn_cctv <- esri2sf(wgtn_cctv_url)\n",
    "\n",
    "# so I think the better approach is just to read in a file that has the data prepared on my workstation and uploaded to kaggle\n",
    "\n",
    "wgtn_cctv <- st_read(\"../input/wgtn-cctv-aug-2025/wgtn_cctv.gpkg\")\n",
    "\n",
    "# weirdly when I do various exports with st_write I seem to get different names for the geometry column compared to what I get from \n",
    "# reading from arcgis online where it's set to geoms... so if it's not geoms then relabel to geoms\n",
    "\n",
    "if (attr(wgtn_cctv, \"sf_column\") != \"geoms\") {\n",
    "    st_geometry(wgtn_cctv) <- \"geoms\"\n",
    "}\n",
    "\n",
    "glimpse(wgtn_cctv)\n",
    "\n",
