    "# wgtn_mbs_less_viewsheds contains units which result in an error when we try to display the tibble in the notebook\n",
    "# so let's just strip them\n",
    "library(units)\n",
    "class(wgtn_mbs_less_viewsheds$ChangeInArea)\n",
    "if (class(wgtn_mbs_less_viewsheds$LandAreaSQ_calc) == 'units') {\n",
    "    wgtn_mbs_less_viewsheds$LandAreaSQ_calc <- units::drop_units(wgtn_mbs_less_viewsheds$LandAreaSQ_calc)    \n",
    "}\n",
    "if (class(wgtn_mbs_less_viewsheds$AreaMinusViewshed ) == 'units') {\n",
    "    wgtn_mbs_less_viewsheds$AreaMinusViewshed  <- units::drop_units(wgtn_mbs_less_viewsheds$AreaMinusViewshed )\n",
    "}\n",
    "if (class(wgtn_mbs_less_viewsheds$ChangeInArea) == 'units') {\n",
    "    wgtn_mbs_less_viewsheds$ChangeInArea <- units::drop_units(wgtn_mbs_less_viewsheds$ChangeInArea)\n",
    "}\n",
