   "source": [
    "vtp_ys <- vtp |>\n",
    "    group_by(year) |>\n",
    "    summarise(v_y = sum(Victimisations))\n",
    "\n",
    "vtp_qtrs <- vtp |> \n",
    "    group_by(year_quarter) |>\n",
    "    summarise(v_qtr = sum(Victimisations))\n",
    "\n",
    "vtp_hys <- vtp |> \n",
    "    group_by(year_half) |>\n",
    "    summarise(v_hy = sum(Victimisations))\n",
    "\n",
    "vtp_yms <- vtp |>\n",
    "    group_by(year_month_dt) |>\n",
    "    summarise(v_ym = sum(Victimisations))\n",
    "\n",
    "\n",
    "gg_vtp_ys <- \n",
    "    ggplot(data = vtp_ys, aes(x = year, y = v_y)) +\n",
    "    geom_line() +\n",
    "    geom_point()\n",
    "\n",
    "gg_vtp_qtrs <- \n",
    "    ggplot(data = vtp_qtrs, aes(x = year_quarter, y = v_qtr)) +\n",
    "    geom_line() +\n",
    "    geom_point()\n",
    "\n",
    "gg_vtp_hys <- \n",
    "    ggplot(data = vtp_hys, aes(x = year_half, y = v_hy)) +\n",
    "    geom_line() +\n",
    "    geom_point()\n",
    "\n",
    "gg_vtp_yms <- \n",
    "    ggplot(data = vtp_yms, aes(x = year_month_dt, y = v_ym)) +\n",
    "    geom_line() +\n",
    "    geom_point()\n",
    "\n",
    "gg_vtp_ys / gg_vtp_hys / gg_vtp_qtrs / gg_vtp_yms + plot_annotation(title = 'What should we use as our maximum extent boundary for time?',\n",
    "                                                       subtitle = \"I'm thinking we can't start prior to 2022\")"
   ]
  },
