   "source": [
    "\n",
    "# Visualising potential viewshed impact on victimisation\n",
    "Big assumption: we suspect the cameras were deployed over the last few years. Our victimisation data goes from June 2021 to the present. What I want to know is has victimisation increased or decreased as we go from early in the camera deployment to close to the current date. To best do this we want our start and end dates to be as far apart as possible, but at the same time... we have to avoid 2021, the lockdowns resulted in an especially low level of victimisation and would distort our analysis.\n",
    "\n",
    "So let's first try 2022 to 2024.\n",
    "\n",
    "What I'd be hoping to see is that as the proportion of area of a meshblock goes under camera viewshed then victimisation drops off. So in the graph below there should ideally be points below 0 and towards the right hand side. But, remember... the viewsheds are only small, typically just a pedestrian walk way or street so maybe 1% of the area of a meshblock."
   ]
  },
